    const [assets,setAssets] = useState([])
    useEffect(()=>{
        getWatchListAssets.then()
    },[])
    return(
        <>
            {err ?
                <Table assets={assets}/>
            :
            <>
                //TODO
            </>
            }
        </>
    )
}

export default Watchlist
